(3, 6729254174912, '', 'testing', '<body>\r\n\r\n\r\n\r\n\r\n<p data-mce-fragment=\"1\"><span style=\"color: #99cc00; font-family: \'mate sc\', serif; font-size: 12pt;\" data-mce-fragment=\"1\"><strong data-mce-fragment=\"1\"><strong data-mce-fragment=\"1\">The Little Black Dress Edition</strong></strong></span></p>\r\n<p data-mce-fragment=\"1\"><span style=\"color: #99cc00; font-family: \'mate sc\', serif; font-size: 12pt;\" data-mce-fragment=\"1\"><em data-mce-fragment=\"1\"><em data-mce-fragment=\"1\">3 ways to styling your little black dresses for every mood and occasion</em></em></span></p>\r\n<p data-mce-fragment=\"1\"><span style=\"color: #99cc00; font-family: \'mate sc\', serif; font-size: 12pt;\"> Portray contemporary cool this summer as you combat the heat with a cute LBD. Frilly hems, prints, high slits and off-shoulder necklines are sweet additions to your LBD that instantly grab attention. For an ultra-casual appeal, opt for a shorter hemline and inject a dose of summer with some brightly coloured sandals like these <a style=\"color: #99cc00;\" href=\"https://www.pazzion.com/product/shoes/sandals/lt6233-38-mud-classic-strap-leather-sandals\" data-mce-fragment=\"1\" aria-invalid=\"true\"><strong data-mce-fragment=\"1\">Classic Strap Leather Sandals</strong></a>. Complete your look with summer essentials like layered necklaces and a straw sunhat!</span></p>\r\n<p data-mce-fragment=\"1\"><span style=\"color: #99cc00; font-family: \'mate sc\', serif; font-size: 12pt;\"> </span></p>\r\n<p data-mce-fragment=\"1\"><span style=\"color: #99cc00; font-family: \'mate sc\', serif; font-size: 12pt;\" data-mce-fragment=\"1\">First introduced by Coco Chanel and popularised by Audrey Hepburn, the style varieties of the “Little Black Dress” have evolved over the years. With black as an all-time favourite colour, it stands to reason why the classic little black dress (LBD) is the hallmark of style longevity.</span></p>\r\n<p data-mce-fragment=\"1\"><span style=\"color: #99cc00; font-family: \'mate sc\', serif; font-size: 12pt;\" data-mce-fragment=\"1\">A must-have piece for every girl, variations of style wonder fit every occasion and mood. Dress it up, dress it down, here are 3 ways to wearing</span></p>\r\n\r\n</body>', 'testing', 0, 'cls_rewriter', 5, '1', '2021-06-17 03:37:35', '2021-06-17 03:37:35'),
